import { StrictMode } from "react";
import ReactDOM from "react-dom";
import App from "./components/App";
import './index.css';

import React, { Component } from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

class Renders extends Component {
  state = { routesList: ["testRoute", "testRoute2"] };

  addRoute = (route, category) => {
    this.setState(
      (previousState) => ({
        routesList: [...previousState.routesList, route]
      }),
      console.log(this.state.routesList)
    );
  };

  render() {
    return (
      <BrowserRouter>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          {this.state.routesList.map((path) => (
            <li key={path}>
              <Link to={`/${path}`}>{path}</Link>
            </li>
          ))}
        </ul>
        <Routes>
          <Route path="/" element={<App callBackFunction={this.addRoute} />} />
          {this.state.routesList.map((routePoint) => (
            <Route
              key={routePoint}
              path={["/", routePoint].join("")}
              element={<p>This route is /{routePoint}</p>}
            />
          ))}
        </Routes>
      </BrowserRouter>
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(
  <StrictMode>
    <Renders />
  </StrictMode>,
  rootElement
);
